import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Message from './components/Message'
import Login from './components/Login'
import Tracking from './components/Tracking'
import Subscribe from './components/Subscribe'
import reportWebVitals from './reportWebVitals';

// Utilizando ReactDOM.render() para algunos contenedores
ReactDOM.render(<App />, document.getElementById('root'));
ReactDOM.render(<Message />, document.getElementById('rootMessage'));

// Utilizando ReactDOM.createRoot() para otros contenedores
const rootLogin = ReactDOM.createRoot(document.getElementById('rootLogin'));
rootLogin.render(<Login />);

const rootSubscribe = ReactDOM.createRoot(document.getElementById('rootSubscribe'));
rootSubscribe.render(<Subscribe />);

const rootTracking = ReactDOM.createRoot(document.getElementById('rootTracking'));
rootTracking.render(<Tracking />);

reportWebVitals();
